import * as React from 'react';
import { StyleSheet, Text } from 'react-native';
import { View, ScrollView } from 'react-native';
import UserRecommendation from './UserRecommendation';

export default () => {

    const users = [
        {
            name: 'Alex Kobuzovs',
            university: 'University of Aberdeen',
            interests: ['computers', 'Windows', 'technical team'],
            id: 1
        },
        {
            name: 'Erin Murphy',
            university: 'University of Aberdeen',
            interests: ['computers', 'macOS', 'business team'],
            id: 2
        },
        {
            name: 'Fergal Duncan-Cox',
            university: 'University of Aberdeen',
            interests: ['computers', 'Windows', 'technical team'],
            id: 3
        },
        {
            name: 'James Strachan',
            university: 'University of Aberdeen',
            interests: ['computers', 'macOS', 'business team'],
            id: 4
        },
        {
            name: 'Joanna Chojnowska',
            university: 'University of Aberdeen',
            interests: ['computers', 'Windows', 'business team'],
            id: 5
        },
        {
            name: 'Paul Schreiber',
            university: 'University of Aberdeen',
            interests: ['computers', 'macOS', 'technical team'],
            id: 6
        },
        {
            name: 'Sasha Gdaniec',
            university: 'University of Aberdeen',
            interests: ['computers', 'Windows', 'business team'],
            id: 7
        },
        {
            name: 'Warren Braggs',
            university: 'University of Aberdeen',
            interests: ['computers', 'macOS', 'technical team'],
            id: 8
        },
    ]

    const recommendations = users.map(user => {
        return (<UserRecommendation user={user} key={user.id} />)
    });


    console.log('recommendations')

    return (
        <View style={styles.container}>
            <Text style={styles.paragraph}>
                Results:
            </Text>
            <ScrollView>
                {recommendations}
            </ScrollView>
        </View>
    );
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#ecf0f1',
        padding: 8,
    },
    paragraph: {
        margin: 24,
        fontSize: 18,
        fontWeight: 'bold',
    },
});
